import React, { useState, useContext } from 'react';
import { Link } from "react-router-dom";
import "./css/Header.css";
import Context from './Context';

export default function HeaderNav() {
    
    const { setMobile } = useContext(Context);
    const handleClick = ()=> {
        setMobile(false)
    }

    return (
        <div className="HeaderNav-wrapper">
            <ul className="Header-nav-mobile">
                <li className="Header-item">
                    <Link to="/" onClick={handleClick}>home</Link>
                </li>
                <li className="Header-item">
                    <Link to="/about" onClick={handleClick}>about</Link>
                </li>
                <li className="Header-item">
                    <Link to="/portfolio" onClick={handleClick}>portfolio</Link>
                </li>
                <links className="Header-item">
                    <Link to="/contact" onClick={handleClick}>contact</Link>
                </links>
                <li className="Header-item">
                    <Link to="/blog" onClick={handleClick}>blog</Link>
                </li>
            </ul>
        </div>
    )
};
